def bubble_sort(arr):
    n = len(arr)
    for i in range(n-1):
        for j in range(n-i-1):
            if arr[j] > arr[j+1]:
                arr[j], arr[j+1] = arr[j+1], arr[j]
    return arr
```
This is a simple implementation of bubble sort algorithm in Python. It takes an array as input and returns the sorted array. It works by comparing adjacent elements and swapping them if they are in wrong order. It then continues this process until the entire array is sorted.
