import React from "react";
import { CSSTransition } from "react-transition-group";

const Popup = ({ children }) => (
  <CSSTransition
    in={true}
    timeout={300}
    classNames="popup"
    unmountOnExit
    appear={true}
  >
    {children}
  </CSSTransition>
);

export default Popup;
```
This is a simple React functional component that renders a `CSSTransition` component with the `in` prop set to `true`. This will give the appearance of a popup that is always visible. The `timeout` prop is set to `300` milliseconds, indicating how long the transition should take when the component is unmounted. The `classNames` prop is set to `"popup"`, which can be used to style the popup using CSS. The `unmountOnExit` prop is set to `true` so that the transition will be triggered when the component is unmounted. The `appear` prop is set to `true` to give the appearance of the popup fading into view.

