 Sure! Here's an example of how you can serve a ReactJS app using an ExpressJS server with TypeScript:
```typescript
const express = require('express');
const path = require('path');
const React = require('react');
// Assume you have a React component file named `App.jsx` in your client folder
const App = require('./client/App').default;

const app = express();

// Serve static assets from the client folder
app.use(express.static(path.join(__dirname, 'client')));

// Render React component to the root route
app.get('/', (req, res) => {
  res.send(React.createElement(App));
});

// Start the server
const port = process.env.PORT || 3000;
app.listen(port, () => {
  console.log(`Server started on port ${port}`);
});
```
Here, we're using Express to serve static assets from the `client` folder and render the React component to the root route (`/`), which will be handled by the `App` component. Then, we start the server and listen for incoming connections.

Make sure you have a basic file structure like this:
```lua
project/
  |- client/
  |  |- App.jsx
  |  |- index.js
  |- server.ts
```
In this example, we assume that `App.jsx` is named `App.jsx`, but feel free to adjust to your own naming convention. The `index.js` file in the client folder determines how the React app is bootstrapped. It's also where you would typically configure your client-side routing if needed.

